// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DocumentStorage {

    // Struct to store document details
    struct Document {
        uint256 uniqueId;           // Auto-incremented Unique ID for the document
        string name;                // Document name
        string cid;                 // CID from IPFS
        address uploader;           // Address of the uploader
        address[] permissions;      // Array of addresses with permission
    }

    // Mapping to store documents by uploader
    mapping(address => Document[]) private userDocuments;

    // Mapping to store documents by unique ID
    mapping(uint256 => Document) private documentsById;

    // Variable to keep track of the last uniqueId assigned
    uint256 private currentId;

    // Event to log when a document is uploaded
    event DocumentUploaded(address indexed uploader, uint256 uniqueId, string name, string cid);

    // Constructor to initialize the uniqueId starting point
    constructor() {
        currentId = 1; // Initialize ID from 1
    }

    // Function to upload a document
    function uploadDocument(string memory _name, string memory _cid) public {
        // Initialize an empty permissions array with uploader's address
        address[] memory permissions = new address[](1); // Create a dynamic array with 1 element
        permissions[0] = msg.sender;  // Add the uploader (msg.sender) to the array

        // Create the document with auto-incrementing uniqueId and initialized permissions
        Document memory newDocument = Document({
            uniqueId: currentId,
            name: _name,
            cid: _cid,
            uploader: msg.sender,
            permissions: permissions  // Set the permissions array
        });

        // Add the document to the user's list
        userDocuments[msg.sender].push(newDocument);
        // Store the document in the global mapping for quick access
        documentsById[currentId] = newDocument;

        // Emit event
        emit DocumentUploaded(msg.sender, currentId, _name, _cid);

        // Increment the uniqueId for the next document
        currentId++;
    }

    // Function to retrieve all documents uploaded by the caller
    function getDocumentsByUser() public view returns (Document[] memory) {
        return userDocuments[msg.sender];
    }

    // Function to retrieve the CID based on the unique ID
    function getCidByUniqueId(uint256 _uniqueId) public view returns (string memory) {
        Document storage doc = documentsById[_uniqueId];

        // Check if the document exists
        require(doc.uniqueId != 0, "Document not found with the given uniqueId.");
        return doc.cid;
    }

    // Function to check if a user has permission to access a document
    function hasPermission(uint256 _uniqueId, address _user) public view returns (bool) {
        Document storage doc = documentsById[_uniqueId];

        // Check if the document exists
        require(doc.uniqueId != 0, "Document not found with the given uniqueId.");

        // Check if the user exists in the permissions array
        for (uint256 j = 0; j < doc.permissions.length; j++) {
            if (doc.permissions[j] == _user) {
                return true;
            }
        }
        return false;
    }

    // Function to grant permission to another user
    function grantPermission(uint256 _uniqueId, address _user) public {
        Document storage doc = documentsById[_uniqueId];

        require(doc.uploader == msg.sender, "Only the owner can grant permission.");
        require(!hasPermission(_uniqueId, _user), "User already has permission.");

        // Add the new user to permissions
        doc.permissions.push(_user); 
    }

    // Function to revoke permission from another user
    function revokePermission(uint256 _uniqueId, address _user) public {
        Document storage doc = documentsById[_uniqueId];

        require(doc.uploader == msg.sender, "Only the owner can revoke permission.");
        require(hasPermission(_uniqueId, _user), "User does not have permission.");

        // Find and remove the user's permission
        for (uint256 j = 0; j < doc.permissions.length; j++) {
            if (doc.permissions[j] == _user) {
                // Replace the user being removed with the last element
                doc.permissions[j] = doc.permissions[doc.permissions.length - 1]; 
                doc.permissions.pop(); // Remove the last element
                return;
            }
        }
    }

    // Function to get the list of users who have permission to access a document
    function getPermissions(uint256 _uniqueId) public view returns (address[] memory) {
        Document storage doc = documentsById[_uniqueId];

        require(doc.uniqueId != 0, "Document not found with the given uniqueId.");

        return doc.permissions;
    }
}
